import React, { Component } from 'react';


class App extends Component {
    state = {
      isLoading: true,
      groups: []
    };

    async componentDidMount() {
      const response = await fetch('/quiz');
      const body = await response.json();
      console.log(response)
      this.setState({ groups: body, isLoading: false });
    }

    render() {
      const {groups, isLoading} = this.state;

      if (isLoading) {
        return <p>Loading...</p>;
      }

      return (
        <div className="App">
            <ul>
            <li className="qizItem">
                <span style={{
                    "marginLeft":"50px",
                    "fontSize":"23px"
                }}>{this.props.quiz.title}</span>
                <div className="qiuzDiv">
                <button type="button" className="btnQuiz">Teoria</button>
                <button type="button" className="btnQuiz">Rozwiąż Quiz</button>
                </div>
            </li>
            </ul>
              <h2>{this.state.groups.map(group =>
                <div key={group.id}>
                  {group.name}
                </div>
              )}</h2>

        </div>
      );
    }
  }

  export default App;
